import React from "react"
import { useState } from "react";

const [count, setCount] = useState(0) ;


function Tour(){

    function incrementHandle(){
        setCount(count+1);
    }
    function decrementHandle(){
        setCount(count-1);
    }

    return(
        <div>
           <div className="counter">
            <button className="plus">+</button>
            <div className="value" onClick={incrementHandle}>{count}</div>
            <button className="minus" onClick={decrementHandle}>-</button>
        </div>
        </div>
    );
}

export default Tour;
